import axios from 'axios';
import React from 'react';

export const Projects = (props) => {

    state = { details: [], }

    let getProjects = 
    axios.get('http://localhost:8000')
        .then(res => {
            data = res.data;
            this.setState({
                details: data
            });
        })
        .catch(err => { })



    return (
        <div>
            <header>Projects</header>
            <hr></hr>
            {
                this.state.details.map((output, id) => (
                    <div key={id}>
                        <div>
                            <h2>{output.name}</h2>
                            <p>{output.description}</p>
                        </div>
                    </div>
                ))
            }


        </div >

    )
}
